      SELECT col2 * - + col0 + col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL > - ( + - 89 ) * + col1 * + col0 + - 66 * - + ( col0 ) + + + col2 + col2;
  - name: tab0

outputs:
  - name: q10064.out
    data: |
